import React from 'react';
import {
    Container,
    Typography,
    Box,
    Card,
    CardContent,
    Button,
    Chip,
    Divider
} from '@mui/material';
import { styled } from '@mui/material/styles';
import RestoreIcon from '@mui/icons-material/Restore';
import DeleteIcon from '@mui/icons-material/Delete';

const StyledCard = styled(Card)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    transition: 'transform 0.2s',
    '&:hover': {
        transform: 'translateY(-2px)'
    }
}));

const SearchHistoryPage = ({ history, onRestoreSearch, onDeleteSearch }) => {
    return (
        <Container maxWidth="lg" sx={{ py: 4 }}>
            <Typography variant="h4" gutterBottom>
                Siste søk
            </Typography>
            
            {history.map((item) => (
                <StyledCard key={item.id}>
                    <CardContent>
                        <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                            <Box>
                                <Typography variant="h6">
                                    {item.course_name}
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Søkt {new Date(item.created_at).toLocaleString('nb-NO')}
                                </Typography>
                            </Box>
                            <Box>
                                <Button
                                    startIcon={<RestoreIcon />}
                                    onClick={() => onRestoreSearch(item)}
                                    variant="contained"
                                    sx={{ mr: 1 }}
                                >
                                    Vis søk
                                </Button>
                                <Button
                                    startIcon={<DeleteIcon />}
                                    onClick={() => onDeleteSearch(item.id)}
                                    variant="outlined"
                                    color="error"
                                >
                                    Slett
                                </Button>
                            </Box>
                        </Box>
                        
                        <Divider sx={{ my: 2 }} />
                        
                        <Box sx={{ mb: 2 }}>
                            <Typography variant="subtitle2" gutterBottom>
                                Søketekst:
                            </Typography>
                            <Typography variant="body2" color="text.secondary">
                                {item.course_description}
                            </Typography>
                        </Box>
                        
                        <Box>
                            <Typography variant="subtitle2" gutterBottom>
                                Resultater:
                            </Typography>
                            <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap' }}>
                                {item.results?.slice(0, 3).map((result) => (
                                    <Chip
                                        key={result.kurskode}
                                        label={`${result.kurskode} (${result.similarity}%)`}
                                        color={
                                            result.similarity >= 70 ? 'success' :
                                            result.similarity >= 50 ? 'warning' : 'error'
                                        }
                                        variant="outlined"
                                    />
                                ))}
                                {item.results?.length > 3 && (
                                    <Chip
                                        label={`+${item.results.length - 3} flere`}
                                        variant="outlined"
                                    />
                                )}
                            </Box>
                        </Box>
                    </CardContent>
                </StyledCard>
            ))}
        </Container>
    );
};

export default SearchHistoryPage;
